import React, {FC, ReactElement} from "react";
import { TextField } from "@mui/material";
import { ITextField } from "./ITextField";

export const TitleField: FC<ITextField> = (
    props
): ReactElement =>{
    const { onChange = (e) => console.log(e),
        disabled = false,
    } = props;
    return (
        <TextField
            id={"title"}
            label={"Title"}
            placeholder={"Title"}
            variant={"outlined"}
            size={"small"}
            name={"title"}
            fullWidth
            disabled={false}
            onChange={onChange}
        />
    )
}
